import Card from './Card'
import movies from './Sdata'

function App() {
    return (
        <>
            <Card  
            head={movies[0].name} 
            info={movies[0].description}
            link={movies[0].wikipediaLink}
            imagelink={movies[0].imageLink}
            />
        
        </>
    )
}
export default App;
